import React from 'react';

import Header from './Header/index';

export default function App() {
  return (
      <div style={styles.app}>
        <Header />
      </div>
  );
}

const styles = {
  app: {
    position: 'absolute',
    alignItems: 'center',
    with: '100%',
    height: '100%',
    backgroundColor: '#999',
  },
};
